import React from 'react';
import Node from '../image/5.jpg';
import { NavLink } from 'react-router-dom';

import LinkPage from '../components/LinkPage';


function About() {
    return (
        <>
          <LinkPage 
           name='Welcome to About page' 
           imgsrc={Node} 
           visit= '/contact' 
           btname='Contact Now' />
        </>
    );

};

export default About;
